export const MenuItems = [
    {
        title: 'Main',
        url:'#',
        cName:'nav-links'
    },
    {
        title: 'Contact us',
        url:'#',
        cName:'nav-links'
    },
    {
        title: 'Log in',
        url:'#"',
        cName:'nav-links'
    },
    {
        title: 'Sign up',
        url:'#',
        cName:'nav-links'
    }
]
